query.sfwSql:
DECLARE @PERSON_ID INT SELECT @PERSON_ID = PERSON_ID FROM SGT_PERSON_ACCOUNT WHERE PERSON_ACCOUNT_ID = @PERSONACCOUNTID
IF EXISTS(SELECT 1 FROM SGT_PERSON_ACCOUNT_EMPLOYMENT_DETAIL PAED WITH(NOLOCK) WHERE PERSON_EMPLOYMENT_DTL_ID = @PERSONEMPLOYMENTDTLID AND PAED.ELECTION_VALUE='ENLD' AND PAED.PERSON_ACCOUNT_ID > 0) BEGIN DECLARE @PREVIOUSEMPENDDATE DATETIME SELECT TOP 1 @PREVIOUSEMPENDDATE = PE.[END_DATE] FROM SGT_PERSON_EMPLOYMENT_DETAIL PED WITH(NOLOCK) JOIN SGT_PERSON_EMPLOYMENT PE WITH(NOLOCK) ON PE.PERSON_EMPLOYMENT_ID = PED.PERSON_EMPLOYMENT_ID AND EXISTS ( SELECT 1 FROM SGT_PERSON_ACCOUNT_FLEX_COMP_HISTORY WHERE PLAN_PARTICIPATION_STATUS_VALUE = 'ENL4' AND PERSON_ACCOUNT_ID = @PERSONACCOUNTID AND EFFECTIVE_START_DATE != ISNULL(EFFECTIVE_END_DATE, '99991231') AND YEAR(EFFECTIVE_START_DATE) = @YEAR
) WHERE PE.[END_DATE] IS NOT NULL AND PERSON_ID = @PERSON_ID ORDER BY PE.[START_DATE] DESC, ISNULL(PE.END_DATE, '99991231') DESC
--PRINT @PREVIOUSEMPENDDATE SELECT CASE WHEN @PREVIOUSEMPENDDATE IS NULL THEN 0 WHEN DATEDIFF(DAY, @PREVIOUSEMPENDDATE, @CURRENTEMPSTARTDATE) > 31 THEN 1 ELSE 0 END END ELSE BEGIN DECLARE @PREVIOUSEMPENDDATE1 DATETIME SELECT TOP 1 @PREVIOUSEMPENDDATE1 = PE.[END_DATE] FROM SGT_PERSON_ACCOUNT_EMPLOYMENT_DETAIL PAED WITH(NOLOCK) JOIN SGT_PERSON_EMPLOYMENT_DETAIL PED WITH(NOLOCK) ON PAED.PERSON_EMPLOYMENT_DTL_ID = PED.PERSON_EMPLOYMENT_DTL_ID AND PAED.PLAN_ID = 18 AND PAED.PERSON_ACCOUNT_ID = @PERSONACCOUNTID AND PAED.ELECTION_VALUE = 'ENLD' JOIN SGT_PERSON_EMPLOYMENT PE WITH(NOLOCK) ON PE.PERSON_EMPLOYMENT_ID = PED.PERSON_EMPLOYMENT_ID AND EXISTS ( SELECT 1 FROM SGT_PERSON_ACCOUNT_FLEX_COMP_HISTORY WHERE PLAN_PARTICIPATION_STATUS_VALUE = 'ENL4' AND PERSON_ACCOUNT_ID = @PERSONACCOUNTID AND EFFECTIVE_START_DATE != ISNULL(EFFECTIVE_END_DATE, '99991231') AND YEAR(EFFECTIVE_START_DATE) = @YEAR
) ORDER BY PE.[START_DATE] DESC, ISNULL(PE.END_DATE, '99991231') DESC
SELECT CASE WHEN @PREVIOUSEMPENDDATE1 IS NULL THEN 0 WHEN DATEDIFF(DAY, @PREVIOUSEMPENDDATE1, @CURRENTEMPSTARTDATE) > 31 THEN 1 ELSE 0 END END
